import React, { Component } from 'react';
import './app.css';

class Navbar extends Component {
  render() {
    return (
      <nav className='navbar'>
        <span>
          <i className='fab fa-affiliatetheme'></i>
        </span>
        <span>Habit Tracker</span>
        <span className='habits-count'>0</span>
      </nav>
    );
  }
}

export default Navbar;
